    let employee = [
        {
            id:1,
            name:'john',
            age:24,
            designation:'engineer'
        },
        {
            id:2,
            name:'sampath',
            age:26,
            designation: 'developer'
        }
    ];

  return (
    <div className="App">
      <nav className="main-nav">
          <a href="/">Wellcome to Components</a>
      </nav>
        <FuncCard info={heading} employee={employees}/>
        <ClassCard info={heading} employee={employees}/>
    </div>
  );
}

export default App;
